//SPDX-License-Identifier:MIT

pragma solidity ^0.8.0;

/// @title Owner & Nominee Functionality
/// @author Bhumi Sadariya

import "../node_modules/@openzeppelin/contracts/access/Ownable.sol";

contract Inheritokens is Ownable {
    constructor() Ownable() {}

    // all owner's addresses into an array and mapping to check if the owner is already added or not.
    address[] public owners;
    mapping(address => bool) public isOwnerAdded;

    // Owner structure and mapping of the owner's address with Owner structure
    struct Owner {
        string owner_name;
        string owner_email;
        string image_cid;
        string date;
        bool isEmailVerified;
        bool isClaimable;
        bool isResponsed;
        address recoveryAddress;
        address[] nominees;
        uint[] charities;
        uint monthsOfInactivity;
        uint monthsOfSendingMailToOwner;
        uint monthsForNominee;
    }
    mapping(address => Owner) public addressToOwner;

    // Nominee structure and mapping of the owner's address to nominee's address to the nominee structure
    struct Nominee {
        string nominee_name;
        string nominee_email;
        address nominee_address;
    }
    mapping(address => mapping(address => Nominee)) public addressToNominee;
    // mapping of owner's address to nominee address to bool to check whether nominee is added or not
    mapping(address => mapping(address => bool)) public isNomineeAdded;

    // Token Structure
    struct Token {
        address token_address;
        string token_name;
        uint category;
        uint token_id;
        uint allocated_share;
        bool isNominated;
    }
    // mapping of owner address to token address to token structure
    mapping(address => mapping(address => Token))
        public tokenAddressToTokenStruct;
    // mapping of owner address to nft address to token id to token struct
    mapping(address => mapping(address => mapping(uint => Token)))
        public nftAddressToTokenStruct;

    // multiplePriorityNominee contract address
    address multiplePriorityContract;

    // modifiers
    modifier ownerNotAdded() {
        require(
            !isOwnerAdded[msg.sender],
            "You've already signed up! No further registration is required."
        );
        _;
    }

    modifier ownerAdded(address _owner) {
        require(isOwnerAdded[_owner], "You must first sign up for an account.");
        _;
    }

    modifier emailVerified(address _owner) {
        require(
            addressToOwner[_owner].isEmailVerified,
            "Your email has not yet been validated. Verify your registered email address first."
        );
        _;
    }

    // events
    event OwnerRegistered(address indexed _owner, string _name);
    event EmailVerified(address indexed _owner);
    event RecoveryAddressAdded(
        address indexed _owner,
        address _recoveryAddress
    );
    event TimePeriodsUpdated(
        address indexed _owner,
        uint _inactivity,
        uint _mail,
        uint _nominee
    );
    event NomineeAdded(
        address indexed _owner,
        address _nominee,
        string _name,
        string _mail
    );
    event NomineeDetailsUpdated(
        address indexed _owner,
        address indexed _oldAddress,
        address indexed _newAddress,
        string _name,
        string _mail
    );
    event CharityWhitelisted(address indexed _owner, uint _charityId);
    event TokenStructureAssigned(
        address indexed _owner,
        address indexed _tokenAddress,
        uint indexed _tokenId
    );
    event AllocatedShareUpdated(
        address indexed _owner,
        address indexed _tokenAddress,
        uint _amount
    );
    event ResponsedDateSet(address indexed _owner, string _date);
    event OwnerResponded(address indexed _owner);

    // owner-----------------------------------------------------------------------

    /// @param _name is the owner's name, _email is the owner's email, and _cid is the cid of profile image.
    function addOwnerDetails(
        string memory _name,
        string memory _email,
        string memory _cid
    ) public ownerNotAdded {
        owners.push(msg.sender);
        addressToOwner[msg.sender].owner_name = _name;
        addressToOwner[msg.sender].owner_email = _email;
        addressToOwner[msg.sender].image_cid = _cid;
        addressToOwner[msg.sender].isEmailVerified = false;
        addressToOwner[msg.sender].isClaimable = false;
        addressToOwner[msg.sender].monthsOfInactivity = 6;
        addressToOwner[msg.sender].monthsOfSendingMailToOwner = 2;
        addressToOwner[msg.sender].monthsForNominee = 2;
        isOwnerAdded[msg.sender] = true;
        emit OwnerRegistered(msg.sender, _name);
    }

    // edit owner's details
    /// @param _name is the owner's name, _email is the owner's email, and _cid is the cid of profile image.
    function editOwnerDetails(
        string memory _name,
        string memory _email,
        string memory _cid
    ) public ownerAdded(msg.sender) {
        addressToOwner[msg.sender].owner_name = _name;
        addressToOwner[msg.sender].owner_email = _email;
        addressToOwner[msg.sender].image_cid = _cid;
    }

    // verify owner's email
    function verifyOwnerEmail(address _owner) public onlyOwner {
        require(isOwnerAdded[_owner], "You must first sign up for an account.");
        require(
            !addressToOwner[_owner].isEmailVerified,
            "Your email has already been verified."
        );
        addressToOwner[_owner].isEmailVerified = true;
        emit EmailVerified(_owner);
    }

    /// @param _recoveryAddress is the address which owner wants to add as a backup address
    function addWalletRecovery(
        address _recoveryAddress
    ) public ownerAdded(msg.sender) emailVerified(msg.sender) {
        addressToOwner[msg.sender].recoveryAddress = _recoveryAddress;
        emit RecoveryAddressAdded(msg.sender, _recoveryAddress);
    }

    function changeTimePeriods(
        uint _inactivity,
        uint _mail,
        uint _nominee
    ) public ownerAdded(msg.sender) emailVerified(msg.sender) {
        addressToOwner[msg.sender].monthsOfInactivity = _inactivity;
        addressToOwner[msg.sender].monthsOfSendingMailToOwner = _mail;
        addressToOwner[msg.sender].monthsForNominee = _nominee;
        emit TimePeriodsUpdated(msg.sender, _inactivity, _mail, _nominee);
    }

    /// @return uint indicating the total number of owners on our platform
    function getTotalOwners() public view returns (uint) {
        return owners.length;
    }

    /// @return an array of owner's address
    function getOwners() public view returns (address[] memory) {
        return owners;
    }

    /// @param _owner is the owner's address
    /// @return owner structure
    function getOwnerDetails(
        address _owner
    ) public view returns (Owner memory) {
        return addressToOwner[_owner];
    }

    function checkOwnerAdded(address _owner) public view returns (bool) {
        return isOwnerAdded[_owner];
    }

    function checkEmailVerified(address _owner) public view returns (bool) {
        return addressToOwner[_owner].isEmailVerified;
    }

    function getAllNomineesOfOwner(
        address _owner
    ) public view returns (address[] memory) {
        return addressToOwner[_owner].nominees;
    }

    // nominee---------------------------------------------------------------------

    /// @param _name is the nominee's name, _email is the nominee's email, and _nominee is the nominee's address
    function addNomineesDetails(
        string memory _name,
        string memory _email,
        address _nominee
    ) public ownerAdded(msg.sender) emailVerified(msg.sender) {
        require(
            !isNomineeAdded[msg.sender][_nominee],
            "This nominee's address has already been added. Try adding a nominee with another account address."
        );
        addressToNominee[msg.sender][_nominee] = Nominee(
            _name,
            _email,
            _nominee
        );
        addressToOwner[msg.sender].nominees.push(_nominee);
        isNomineeAdded[msg.sender][_nominee] = true;
        emit NomineeAdded(msg.sender, _nominee, _name, _email);
    }

    /// @param _oldNomineeAddress is the old account address of the nominee,
    // _name is the nominee's name, _email is the nominee's email, and _newNomineeAddress is the nominee's address
    function editNomineeDetails(
        address _oldNomineeAddress,
        string memory _name,
        string memory _email,
        address _newNomineeAddress
    ) public ownerAdded(msg.sender) emailVerified(msg.sender) {
        require(
            isNomineeAdded[msg.sender][_oldNomineeAddress],
            "The nominee's address is not added. So you can't modify the details of this account's address. Please enter the valid address of the nominee."
        );
        for (
            uint256 i = 0;
            i < addressToOwner[msg.sender].nominees.length;
            i++
        ) {
            if (addressToOwner[msg.sender].nominees[i] == _oldNomineeAddress) {
                addressToOwner[msg.sender].nominees[i] = _newNomineeAddress;
                addressToNominee[msg.sender][_newNomineeAddress]
                    .nominee_name = _name;
                addressToNominee[msg.sender][_newNomineeAddress]
                    .nominee_email = _email;
                addressToNominee[msg.sender][_newNomineeAddress]
                    .nominee_address = _newNomineeAddress;
            }
        }
        emit NomineeDetailsUpdated(
            msg.sender,
            _oldNomineeAddress,
            _newNomineeAddress,
            _name,
            _email
        );
    }

    /// @param _owner is the owner address
    /// @return array of nominees's id
    function getAllNominees(
        address _owner
    ) public view returns (address[] memory) {
        return addressToOwner[_owner].nominees;
    }

    /// @param _nominee is the nominee address
    /// @return nominee structure
    function getNomineeDetails(
        address _owner,
        address _nominee
    ) public view returns (Nominee memory) {
        return addressToNominee[_owner][_nominee];
    }

    // charity-------------------------------------------------------------------

    /// @param _charityId is the ID of the charity that the owner wants to keep in the whitelisted array.
    function setWhiteListedCharities(
        uint _charityId
    ) public ownerAdded(msg.sender) emailVerified(msg.sender) {
        addressToOwner[msg.sender].charities.push(_charityId);
        emit CharityWhitelisted(msg.sender, _charityId);
    }

    function getWhiteListedCharities(
        address _owner
    ) public view returns (uint[] memory) {
        return addressToOwner[_owner].charities;
    }

    // multiple nominee--------------------------------------------------------

    /// @param _tokenAddress is the address of the token, _tokenName is the name of the token,
    // _category is the ERC20 or ERC721, _tokenId is the id of the ERC721, and amount is the allocated share of the ERC20
    function assignTokenStruct(
        address _owner,
        address _tokenAddress,
        string memory _tokenName,
        uint _category,
        uint _tokenId,
        uint amount
    ) external ownerAdded(_owner) emailVerified(_owner) {
        require(
            msg.sender == multiplePriorityContract,
            "Oops! You cannot call this function. The caller should be contract."
        );
        // for token
        if (_category == 0) {
            tokenAddressToTokenStruct[_owner][_tokenAddress] = Token(
                _tokenAddress,
                _tokenName,
                _category,
                _tokenId,
                amount,
                true
            );
        }
        // for NFT
        else {
            nftAddressToTokenStruct[_owner][_tokenAddress][_tokenId] = Token(
                _tokenAddress,
                _tokenName,
                _category,
                _tokenId,
                amount,
                true
            );
        }

        emit TokenStructureAssigned(_owner, _tokenAddress, _tokenId);
    }

    /// @param _owner is the address of the owner, _tokenAddress is the token address, and amount is the allocated share of ERC20
    function updateAllocatedShare(
        address _owner,
        address _tokenAddress,
        uint _tokenId,
        uint _amount,
        uint _category
    ) external ownerAdded(_owner) emailVerified(_owner) {
        require(
            msg.sender == multiplePriorityContract,
            "Oops! You cannot call this function. The caller should be contract."
        );
        // for token
        if (_category == 0) {
            tokenAddressToTokenStruct[_owner][_tokenAddress]
                .allocated_share = _amount;
        }
        // for NFT
        else {
            nftAddressToTokenStruct[_owner][_tokenAddress][_tokenId]
                .allocated_share = _amount;
        }
        emit AllocatedShareUpdated(_owner, _tokenAddress, _amount);
    }

    /// @param _owner is the address of the owner, _tokenAddress is the address of the token, _tokenId is the id of the NFT,
    // _category is the ERC20 or ERC721
    /// @return Token structure
    function getTokenStruct(
        address _owner,
        address _tokenAddress,
        uint _tokenId,
        uint _category
    ) public view returns (Token memory) {
        if (_category == 0) {
            return tokenAddressToTokenStruct[_owner][_tokenAddress];
        } else {
            return nftAddressToTokenStruct[_owner][_tokenAddress][_tokenId];
        }
    }

    // response-----------------------------------------------------

    /// @param _owner is the owner's address, _date is the date on which we sent the first mail to the nominee.
    function setResponseDate(
        address _owner,
        string memory _date
    ) public onlyOwner {
        addressToOwner[_owner].date = _date;
        emit ResponsedDateSet(_owner, _date);
    }

    // Function to call when user respond to our email
    function setResponse()
        public
        ownerAdded(msg.sender)
        emailVerified(msg.sender)
    {
        addressToOwner[msg.sender].isResponsed = true;
        emit OwnerResponded(msg.sender);
    }

    /// @param _owner is the owner's address
    function setOwnerNotAlive(address _owner) public onlyOwner {
        require(
            !addressToOwner[_owner].isResponsed,
            "Owner has already responded."
        );
        addressToOwner[_owner].isClaimable = true;
    }

    function getIsClaimable(address _owner) public view returns (bool) {
        return addressToOwner[_owner].isClaimable;
    }

    // set multiplePriorityContract address
    function setMultiplePriorityAddress(address _contract) public onlyOwner {
        multiplePriorityContract = _contract;
    }
}

contracts/MultiplePriorityNominee.sol.content:
//SPDX-License-Identifier:MIT

pragma solidity ^0.8.0;

import "../node_modules/@openzeppelin/contracts/access/Ownable.sol";
import "../node_modules/@openzeppelin/contracts/token/ERC20/IERC20.sol";
import "../node_modules/@openzeppelin/contracts/token/ERC721/IERC721.sol";

/// @title Multiple nominee and Priority nominee Functionality
/// @author Bhumi Sadariya

import "./Inheritokens.sol";
import "./Charity.sol";

contract MultiplePriorityNominee is Ownable {
    address public inheritokensAddress;
    Inheritokens public inheritokens;
    address public charityContractAddress;
    CharityContract public charityContract;
    uint public tokenCharge = 1000000;
    uint public nftCharge = 5000000;
    uint public percentage = 1;
    address public chargeTokenAddress =
        0xe9DcE89B076BA6107Bb64EF30678efec11939234; // USDC

    constructor(
        address _inheritokensAddress,
        address _charityContractAddress
    ) Ownable() {
        inheritokensAddress = _inheritokensAddress;
        inheritokens = Inheritokens(inheritokensAddress);
        charityContractAddress = _charityContractAddress;
        charityContract = CharityContract(charityContractAddress);
    }

    // structure for multiple and Priority nominee
    struct MultiplePriority {
        uint share;
        uint charityId;
        address[] nominee;
        bool[] isNotAvailable; // true means not available and false means available
        bool[] isClaimed; // true means nominee has claimed
        bool isDone; // true means it is reached to the charity
    }
    // mapping of owner address to token address to structure
    mapping(address => mapping(address => MultiplePriority[]))
        public ownerToTokenToStruct;

    // mapping of owner address to NFT to struct
    mapping(address => mapping(address => mapping(uint => MultiplePriority[])))
        public ownerToNFTToStruct;

    // event
    event TokensAssigned(
        address indexed _owner,
        address _tokenAddress,
        uint _tokenId,
        uint _category
    );
    event Claimed(
        address indexed _owner,
        address indexed _nominee,
        address indexed _tokenAddress,
        uint _tokenId,
        uint _amount,
        uint _category
    );
    event Recovered(
        address indexed _owner,
        address indexed _tokenAddress,
        uint _tokenId,
        uint _amount,
        uint _category
    );

    /// @param _tokenAddress is the address of the token contract, _tokenName is the name of the token, _category is the integer
    // indecating 0 for token and 1 for nft, _tokenId is the id of the nft, data is the array of MultiplePriority sturucture
    /// @notice If the share is allocated to 100%, then the owner will not be able to add more nominees for
    // this token. Either he has to remove or edit any of those nominees.
    function assignTokensToMultipleNominees(
        address _tokenAddress,
        string memory _tokenName,
        uint _category,
        uint _tokenId,
        MultiplePriority[] memory data
    ) public {
        // owner should be added, and email should be verified
        require(
            inheritokens.checkOwnerAdded(msg.sender),
            "You must first sign up for an account."
        );
        require(
            inheritokens.checkEmailVerified(msg.sender),
            "Your email has not yet been validated. Verify your registered email address first."
        );

        // check passed nominees in data are added
        address[] memory nominees = inheritokens.getAllNomineesOfOwner(
            msg.sender
        );
        bool flag;
        uint[] memory listedCharities = inheritokens.getWhiteListedCharities(
            msg.sender
        );
        bool hasFlag;
        for (uint i = 0; i < data.length; i++) {
            for (uint k = 0; k < data[i].nominee.length; k++) {
                flag = false;
                for (uint j = 0; j < nominees.length; j++) {
                    if (data[i].nominee[k] == nominees[j]) {
                        flag = true;
                        break;
                    }
                }
                if (flag == false) {
                    revert(
                        "Check that all the nominees you are nominating are added as nominees."
                    );
                }
            }
            for (uint j = 0; j < listedCharities.length; j++) {
                if (data[i].charityId == listedCharities[j]) {
                    hasFlag = true;
                    break;
                }
                if (hasFlag == false) {
                    revert(
                        "Check that the charity you are nominating is listed as a white-listed charity."
                    );
                }
            }
        }

        // get data of whether token is nominated at least once
        bool nominated;
        (, , , , , nominated) = inheritokens.tokenAddressToTokenStruct(
            msg.sender,
            _tokenAddress
        );

        // calculate total share by looping over data
        uint totalShare;
        for (uint i = 0; i < data.length; i++) {
            totalShare += data[i].share;
        }

        // proceed only if the total share is less than 100
        require(
            totalShare <= 100,
            "Oops! You can only allocate a 100% share. Try to reduce the share amount."
        );
        // if token is not nominated at least for once then assign data to Token struct of inheritokens contract
        if (!nominated) {
            inheritokens.assignTokenStruct(
                msg.sender,
                _tokenAddress,
                _tokenName,
                _category,
                totalShare,
                _tokenId
            );
        } else {
            IERC20 _token = IERC20(chargeTokenAddress);
            if (_category == 0) {
                require(
                    _token.allowance(msg.sender, address(this)) >= tokenCharge,
                    "The allowance to the contract is not enough!"
                );
                _token.transferFrom(msg.sender, address(this), tokenCharge);
                delete ownerToTokenToStruct[msg.sender][_tokenAddress];
            } else if (_category == 1) {
                require(
                    _token.allowance(msg.sender, address(this)) >= nftCharge,
                    "The allowance to the contract is not enough!"
                );
                _token.transferFrom(msg.sender, address(this), nftCharge);
                delete ownerToNFTToStruct[msg.sender][_tokenAddress][_tokenId];
            } else {
                revert(
                    "The category value must be 0 for tokens and 1 for NFT."
                );
            }
        }
        inheritokens.updateAllocatedShare(
            msg.sender,
            _tokenAddress,
            _tokenId,
            totalShare,
            _category
        );

        // assign data to the Multiple struct
        if (_category == 0) {
            for (uint i = 0; i < data.length; i++) {
                ownerToTokenToStruct[msg.sender][_tokenAddress].push(data[i]);
            }
        } else {
            for (uint i = 0; i < data.length; i++) {
                ownerToNFTToStruct[msg.sender][_tokenAddress][_tokenId].push(
                    data[i]
                );
            }
        }
        emit TokensAssigned(msg.sender, _tokenAddress, _tokenId, _category);
    }

    // claim
    /// @param _owner is the owner's address, _tokenAddress is the address of the token, _amount is the amount of the ERC20,
    // _tokenId is the token Id of the asset
    function claim(
        address _owner,
        address _tokenAddress,
        uint _tokenId,
        uint _category
    ) public {
        bool isClaimable = inheritokens.getIsClaimable(_owner);
        require(
            isClaimable,
            "Sorry! You can't claim this. We will mail you to claim this."
        );
        address[] memory nominees = inheritokens.getAllNomineesOfOwner(_owner);
        uint transferToNominee;
        for (uint i = 0; i < nominees.length; i++) {
            if (nominees[i] == msg.sender) {
                // transfer logic
                // fot tokens
                if (_category == 0) {
                    for (
                        uint k = 0;
                        k < ownerToTokenToStruct[_owner][_tokenAddress].length;
                        k++
                    ) {
                        for (
                            uint j = 0;
                            j <
                            (
                                ownerToTokenToStruct[_owner][_tokenAddress][k]
                                    .nominee
                            ).length;
                            j++
                        ) {
                            if (
                                ownerToTokenToStruct[_owner][_tokenAddress][k]
                                    .nominee[j] == nominees[i]
                            ) {
                                if (j == 0) {
                                    // function call
                                    transferToNominee = tokenTransferLogic(
                                        k,
                                        j,
                                        _tokenAddress,
                                        _owner
                                    );
                                    break;
                                } else {
                                    if (
                                        ownerToTokenToStruct[_owner][
                                            _tokenAddress
                                        ][k].isNotAvailable[j - 1] ==
                                        true &&
                                        ownerToTokenToStruct[_owner][
                                            _tokenAddress
                                        ][k].isClaimed[j - 1] ==
                                        false
                                    ) {
                                        // function call
                                        transferToNominee = tokenTransferLogic(
                                            k,
                                            j,
                                            _tokenAddress,
                                            _owner
                                        );
                                        break;
                                    } else {
                                        revert(
                                            "Oops! You can't claim this right now. We will inform you when you can claim the token."
                                        );
                                    }
                                }
                            }
                        }
                    }
                } else if (_category == 1) {
                    for (
                        uint k = 0;
                        k < ownerToTokenToStruct[_owner][_tokenAddress].length;
                        k++
                    ) {
                        for (
                            uint j = 0;
                            j <
                            (
                                ownerToNFTToStruct[_owner][_tokenAddress][
                                    _tokenId
                                ][k].nominee
                            ).length;
                            j++
                        ) {
                            if (
                                ownerToNFTToStruct[_owner][_tokenAddress][
                                    _tokenId
                                ][k].nominee[j] == nominees[i]
                            ) {
                                if (j == 0) {
                                    // function call
                                    transferNFTLogic(
                                        k,
                                        k,
                                        _tokenId,
                                        _tokenAddress,
                                        _owner
                                    );
                                    break;
                                } else {
                                    if (
                                        ownerToTokenToStruct[_owner][
                                            _tokenAddress
                                        ][k].isNotAvailable[j - 1] ==
                                        true &&
                                        ownerToTokenToStruct[_owner][
                                            _tokenAddress
                                        ][k].isClaimed[j - 1] ==
                                        false
                                    ) {
                                        // function call
                                        transferNFTLogic(
                                            k,
                                            k,
                                            _tokenId,
                                            _tokenAddress,
                                            _owner
                                        );
                                        break;
                                    } else {
                                        revert(
                                            "Oops! You can't claim this right now. We will inform you when you can claim the token."
                                        );
                                    }
                                }
                            }
                        }
                    }
                }
            }
            emit Claimed(
                _owner,
                msg.sender,
                _tokenAddress,
                _tokenId,
                transferToNominee,
                _category
            );
        }
    }

    function tokenTransferLogic(
        uint k,
        uint j,
        address _tokenAddress,
        address _owner
    ) internal returns (uint) {
        uint _share = ownerToTokenToStruct[_owner][_tokenAddress][k].share;
        ownerToTokenToStruct[_owner][_tokenAddress][k].isClaimed[j] = true;

        IERC20 _token = IERC20(_tokenAddress);
        uint _totalToken = _token.balanceOf(_owner);
        uint _finalAmount = (_totalToken * _share) / 100;
        // contract charge
        uint transferToContract = (_finalAmount * percentage) / (10000);

        // value nominee will get
        uint transferToNominee = (_finalAmount - transferToContract);

        // to contract
        _token.transferFrom(_owner, address(this), transferToContract);

        // to nominee
        _token.transferFrom(_owner, msg.sender, transferToNominee);
        return transferToNominee;
    }

    function transferNFTLogic(
        uint k,
        uint j,
        uint _tokenId,
        address _tokenAddress,
        address _owner
    ) internal {
        IERC721 _nft = IERC721(_tokenAddress);

        // transfer to nominee
        _nft.transferFrom(_owner, msg.sender, _tokenId);

        ownerToNFTToStruct[_owner][_tokenAddress][_tokenId][k].isClaimed[
                j
            ] = true;
    }

    // recovery claim
    /// @param _owner is the owner's address, _tokenAddress is the address of the token, _amount is the amount of the ERC20,
    // _tokenId is the token Id of the asset
    function recoveryClaim(
        address _owner,
        address _tokenAddress,
        uint _tokenId,
        uint _category
    ) public {
        // transfer logic
        // fot tokens
        // check the user who is calling the function has the address same as recovery address of the owner
        require(
            inheritokens.getOwnerDetails(_owner).recoveryAddress == msg.sender,
            "The recovery address or owner address is incorrect!"
        );
        uint _totalToken;
        if (_category == 0) {
            IERC20 _token = IERC20(_tokenAddress);
            _totalToken = _token.balanceOf(_owner);

            // contract charge
            uint transferToContract = (_totalToken * percentage) / (10000);

            // value nominee will get
            uint transferToNominee = (_totalToken - transferToContract);

            // to contract
            _token.transferFrom(_owner, address(this), transferToContract);

            // to nominee
            _token.transferFrom(_owner, msg.sender, transferToNominee);
        } else if (_tokenId > 0) {
            IERC721 _token = IERC721(_tokenAddress);
            _token.transferFrom(_owner, msg.sender, _tokenId);
        }
        emit Recovered(_owner, _tokenAddress, _tokenId, _totalToken, _category);
    }

    /// @notice _amount should be multiple with the decimals according to the token
    /// @param _amount is the value for a specific token admin wants to withdraw from the contract, _tokenAddress is the address
    // of the token
    function withdrawFromContract(
        uint _amount,
        address _tokenAddress
    ) public payable onlyOwner {
        IERC20 _token = IERC20(_tokenAddress);
        _token.transfer(msg.sender, _amount);
    }

    // charity claim

    function charityClaim(
        address _owner,
        address _tokenAddress,
        uint _tokenId,
        uint _category
    ) public payable {
        uint[] memory listedCharities = inheritokens.getWhiteListedCharities(
            _owner
        );
        address charityAddress;
        if (_category == 0) {
            for (
                uint i = 0;
                i < ownerToTokenToStruct[_owner][_tokenAddress].length;
                i++
            ) {
                if (
                    ownerToTokenToStruct[_owner][_tokenAddress][i].isDone ==
                    false
                ) {
                    for (
                        uint j = 0;
                        j <
                        ownerToTokenToStruct[_owner][_tokenAddress][i]
                            .isNotAvailable
                            .length;
                        j++
                    ) {
                        if (
                            ownerToTokenToStruct[_owner][_tokenAddress][i]
                                .isNotAvailable[j] ==
                            false &&
                            ownerToTokenToStruct[_owner][_tokenAddress][i]
                                .isClaimed[j] ==
                            true
                        ) {
                            revert(
                                "Sorry! You cannot claim it now. If Nominee does not claim, then we will inform you."
                            );
                        }
                    }

                    for (uint k = 0; k < listedCharities.length; k++) {
                        (, charityAddress, , , ) = charityContract.idToCharity(
                            listedCharities[k]
                        );
                        if (charityAddress == msg.sender) {
                            uint _share = ownerToTokenToStruct[_owner][
                                _tokenAddress
                            ][i].share;
                            IERC20 _token = IERC20(_tokenAddress);
                            // uint _totalToken = _token.balanceOf(_owner);
                            uint _finalAmount = ((_token.balanceOf(_owner)) *
                                _share) / 100;
                            // contract charge
                            uint transferToContract = (_finalAmount *
                                percentage) / (10000);

                            // value charity will get
                            uint transferToCharity = (_finalAmount -
                                transferToContract);

                            // to contract
                            _token.transferFrom(
                                _owner,
                                address(this),
                                transferToContract
                            );

                            // to charity
                            _token.transferFrom(
                                _owner,
                                msg.sender,
                                transferToCharity
                            );
                            ownerToTokenToStruct[_owner][_tokenAddress][i]
                                .isDone = true;
                        }
                    }
                }
            }
        } else if (_category == 1) {
            for (
                uint i = 0;
                i < ownerToNFTToStruct[_owner][_tokenAddress][_tokenId].length;
                i++
            ) {
                if (
                    ownerToNFTToStruct[_owner][_tokenAddress][_tokenId][i]
                        .isDone == false
                ) {
                    for (
                        uint j = 0;
                        j <
                        ownerToNFTToStruct[_owner][_tokenAddress][_tokenId][i]
                            .isNotAvailable
                            .length;
                        j++
                    ) {
                        if (
                            ownerToNFTToStruct[_owner][_tokenAddress][_tokenId][
                                i
                            ].isNotAvailable[j] ==
                            false &&
                            ownerToNFTToStruct[_owner][_tokenAddress][_tokenId][
                                i
                            ].isClaimed[j] ==
                            true
                        ) {
                            revert(
                                "Sorry! You cannot claim it now. If Nominee does not claim, then we will inform you."
                            );
                        }
                    }
                    for (uint k = 0; k < listedCharities.length; k++) {
                        (, charityAddress, , , ) = charityContract.idToCharity(
                            listedCharities[k]
                        );
                        if (charityAddress == msg.sender) {
                            IERC721 _nft = IERC721(_tokenAddress);

                            // transfer to charity
                            _nft.transferFrom(_owner, msg.sender, _tokenId);
                            ownerToNFTToStruct[_owner][_tokenAddress][_tokenId][
                                i
                            ].isDone = true;
                        }
                    }
                }
            }
        }
    }

    /// @notice this function is to change the token we charge while nominating, for example by default the token we charge is USDC
    // _tokenCharge value should be multiply with decimals(wei) according to the token and then passed to this function
    // _nftCharge value should be multiply with decimals(wei) according to the token and then passed to this function
    // _percentage amount must be multiplied with 100 and pass the integer value only, decimal won't work here
    /// @param _tokenAddress is the address of the token which platform wants to charge while owner nominate the nominee
    function changeCharges(
        address _tokenAddress,
        uint _tokenCharge,
        uint _nftCharge,
        uint _percentage
    ) public onlyOwner {
        chargeTokenAddress = _tokenAddress;
        tokenCharge = _tokenCharge;
        nftCharge = _nftCharge;
        percentage = _percentage;
    }
}

